\def\unitLen{0.4in}

% Command to draw angle labels
\newcommand{\angleLabel}[6][0.3in]{%[labelDistance]{center}{startAngle}{endAngle}{positionRatio}{label}
     \centerarc[line width=0.5pt]#2(#3:#4:0.2in);
     \pgfmathsetmacro{\labelAngle}{#5*(#3)+(1-#5)*(#4)}; 
     \node at ($#2+(\labelAngle:#1)$) {#6};
}

\begin{tikzpicture}[x=\unitLen,y=\unitLen]

% Triangle parameters
\def\AngleOne{45}
\def\AngleTwo{62}
\def\AngleThree{73}
\def\Side{6}

\coordinate (LeftPoint) at (0,0);
\coordinate (RightPoint) at (\Side,0);

% Find top vertex using the given angles
\path [name path=RayOne, overlay] (LeftPoint) -- (\AngleOne:40);
\path [name path=RayTwo, overlay] ++(RightPoint) -- +(180-\AngleTwo:40);
\path [name intersections={of=RayOne and RayTwo}] (intersection-1) coordinate (TopPoint);

% Draw Triangle
\draw[thick] (LeftPoint) -- (TopPoint) -- (RightPoint) -- cycle;

% Left angle label (45°)
\angleLabel[0.4in]{(LeftPoint)}{0}{\AngleOne}{0.5}{$45°$}

% Right angle label (62°)
\angleLabel[0.4in]{(RightPoint)}{180}{180-\AngleTwo}{0.5}{$62°$}

% Top angle label (73°)
\angleLabel[0.4in]{(TopPoint)}{180+\AngleOne}{180+\AngleOne+\AngleThree}{0.5}{$73°$}

% Add equation below the triangle
\node at (3,-1.5) {\large $45° + 62° + 73° = 180°$};

\end{tikzpicture}
\end{document}

